import classes from "./Navbar.module.css";
import NavBarItem from "./NavBarItem";

const NavBar = () => {
  const Duummy_navbar = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  return (
    <div className={classes.navbar}>
      <div>
        <p>
          Booking Website <button className={classes.button}>Register</button>
          <button className={classes.button}>Login</button>
        </p>
      </div>

      <div className={classes.navbaritem}>
        {Duummy_navbar.map((data) => (
          <NavBarItem
            type={data[0].type}
            icon={data[0].icon}
            active={data[0].active}
          ></NavBarItem>
        ))}
        <NavBarItem
          type={Duummy_navbar[0].type}
          icon={Duummy_navbar[0].icon}
          active={Duummy_navbar[0].active}
        ></NavBarItem>
        <NavBarItem
          type={Duummy_navbar[1].type}
          icon={Duummy_navbar[1].icon}
          active={Duummy_navbar[1].active}
        ></NavBarItem>
        <NavBarItem
          type={Duummy_navbar[2].type}
          icon={Duummy_navbar[2].icon}
          active={Duummy_navbar[2].active}
        ></NavBarItem>
        <NavBarItem
          type={Duummy_navbar[3].type}
          icon={Duummy_navbar[3].icon}
          active={Duummy_navbar[3].active}
        ></NavBarItem>
        <NavBarItem
          type={Duummy_navbar[4].type}
          icon={Duummy_navbar[4].icon}
          active={Duummy_navbar[4].active}
        ></NavBarItem>
      </div>
    </div>
  );
};

export default NavBar;
